import {makeStyles} from "@material-ui/core/styles";

export default makeStyles((theme) => ({
    //Styling
    paper: {
        padding: '10px',
        display: 'flex',
        justifyContent: 'center',
        width: '100px',
    },

    mapContainer: {
        height: '85vh', width: '100%',
    },

    markerContainer: {
        position: 'absolute',
        transform: 'translate(-50%, -50%)',
        zIndex: 1,
        '&:hover': {zIndex: 2},
    },

    pointer: {
        cursor: 'pointer',
    },
}));
